	.global ArmV30Irq
	.global ArmV30Run
	.global ArmV30CryptTable

ArmV30Irq:
	stmfd sp!,{r4-r12,lr}
	mov r7, r0			@ r7 = Pointer to Cpu Context
	mov r10, r1			@ r10 = Irq vector
	ldr r6, =JumpTables	@ r6 = Opcode Jump table
	ldrh r1, [r7, #0x1A]	@ load NEC flag part
	ldr r9, [r7, #0x20]		@ load ARM flag part
	orr r1, r1, r9
	@ PUSH r1
	ldrh r0, [r7, #0x08]	@ SP
	sub r0, r0, #2
	strh r0, [r7, #0x08]	@ SP
	mov r0, r0, lsl#16
	mov r0, r0, lsr#16
	ldrh r2, [r7, #0x14]	@ SS
	add r0, r0, r2, lsl#4
	ldr r2, [r7, #0x3C]		@ ppMemWrite
	mov r3, r0, lsr#11
	ldr r2, [r2, r3, lsl#2]
	cmp r2, #0
	strneh r1, [r2, r0]
	moveq lr, pc	@ call "write16"
	ldreq pc, [r7, #0x4C]
	ldrh r1, [r7, #0x1A]
	bic r1, r1, #0x0300			@ clear IF and TF
	strh r1, [r7, #0x1A]
	mov r10, r10, lsl#2
	ldrh r1, [r7, #0x12]	@ load PS then PUSH
	@ PUSH r1
	ldrh r0, [r7, #0x08]	@ SP
	sub r0, r0, #2
	strh r0, [r7, #0x08]	@ SP
	mov r0, r0, lsl#16
	mov r0, r0, lsr#16
	ldrh r2, [r7, #0x14]	@ SS
	add r0, r0, r2, lsl#4
	ldr r2, [r7, #0x3C]		@ ppMemWrite
	mov r3, r0, lsr#11
	ldr r2, [r2, r3, lsl#2]
	cmp r2, #0
	strneh r1, [r2, r0]
	moveq lr, pc	@ call "write16"
	ldreq pc, [r7, #0x4C]
	ldrh r1, [r7, #0x18]	@ load IP then PUSH
	@ PUSH r1
	ldrh r0, [r7, #0x08]	@ SP
	sub r0, r0, #2
	strh r0, [r7, #0x08]	@ SP
	mov r0, r0, lsl#16
	mov r0, r0, lsr#16
	ldrh r2, [r7, #0x14]	@ SS
	add r0, r0, r2, lsl#4
	ldr r2, [r7, #0x3C]		@ ppMemWrite
	mov r3, r0, lsr#11
	ldr r2, [r2, r3, lsl#2]
	cmp r2, #0
	strneh r1, [r2, r0]
	moveq lr, pc	@ call "write16"
	ldreq pc, [r7, #0x4C]
	mov r0, r10				@ load int verctor ip
	ldr r2, [r7, #0x38]		@ ppMemRead
	mov r3, r0, lsr#11
	ldr r2, [r2, r3, lsl#2]
	cmp r2, #0
	addne r2, r2, r0
	ldrneb r0, [r2], #1
	ldrneb r3, [r2]
	orrne r0, r0, r3, lsl#8
	moveq lr, pc	@ call "read16"
	ldreq pc, [r7, #0x44]
	strh r0, [r7, #0x18]	@ IP
	mov r11, r0
	add r0, r10, #2			@ load int verctor ps
	ldr r2, [r7, #0x38]		@ ppMemRead
	mov r3, r0, lsr#11
	ldr r2, [r2, r3, lsl#2]
	cmp r2, #0
	addne r2, r2, r0
	ldrneb r0, [r2], #1
	ldrneb r3, [r2]
	orrne r0, r0, r3, lsl#8
	moveq lr, pc	@ call "read16"
	ldreq pc, [r7, #0x44]
	strh r0, [r7, #0x12]	@ PS
	mov r1, r11
	ldr r2, [r7, #0x2C]	@ membase
	add r2, r2, r0, lsl#4
	add r4, r2, r1
	str r4, [r7, #0x28]	@ pc
	ldmfd sp!,{r4-r12,pc}

ArmV30Run:
	stmfd sp!,{r4-r12,lr}
	mov r7, r0			@ r7 = Pointer to Cpu Context
	ldr r6, =JumpTables	@ r6 = Opcode Jump table
	ldr r5, [r7,#0x24]	@ r5 = Cycles
	ldr r4, [r7,#0x28]	@ r4 = Current PC + Memory Base
	ldr r9, [r7,#0x20]	@ r9 = flags  ___ANZCV
	mov r8, #0
	ldrb r2, [r4], #1
	ldr pc, [r6, r2, lsl#2]


ArmNecEnd:
	sub r4, r4, #1
ArmNecEndNoBack:
	str r5, [r7,#0x24]	@ Save Cycles
	str r4, [r7,#0x28]	@ Save Current PC + Memory Base
	ldrh r2, [r7,#0x12]	@ PS
	ldr r3, [r7,#0x2C]	@ Memory Base
	sub r4, r4, r2, lsl#4
	sub r4, r4, r3
	strh r4, [r7,#0x18]	@ Save ip
	str r9, [r7,#0x20]
	mov r0, r5			@ return cycles remain
	ldmfd sp!,{r4-r12,pc}

.ltorg

@--- BITOP branchs -----------------------------------

getEAByte:
	ldrb r2, [r4], #1
	add r3, r6, #0x400
	ldr pc, [r3, r2, lsl#2]

getEAWord:
	ldrb r2, [r4], #1
	add r3, r6, #0x800
	ldr pc, [r3, r2, lsl#2]

