	ldrb r2, [r4], #1
	ldrb r10, [r4], #1
	orr r10, r2, r10, lsl#8
	ldrh r2, [r7, #0x06]		@ BW
	add r10, r10, r2
	ldrh r2, [r7, #0x0c]		@ IX
	add r10, r10, r2
	bic r10, r10, #0x30000
	tst r8, #0x80000000
	ldreqh r8, [r7, #0x16]		@ DS0
	add r8, r10, r8, lsl#4
	mov r0, r8
	ldr r2, [r7, #0x38]		@ ppMemRead
	mov r3, r0, lsr#11
	ldr r2, [r2, r3, lsl#2]
	cmp r2, #0
	addne r2, r2, r0
	ldrneb r0, [r2], #1
	ldrneb r3, [r2]
	orrne r0, r0, r3, lsl#8
	moveq lr, pc	@ call "read16"
	ldreq pc, [r7, #0x44]

	ldrb r1, [r4], #1	;@ fetch word
	ldrb r2, [r4], #1
	orr r1, r1, r2, lsl#8

	mov r0, r0, lsl#16
	orrs r0, r0, r1, lsl#16
	mrs r2, cpsr		@ NZCV
	mov r9, r0, lsl#8
	orr r9, r9, r2, lsr#28

	mov r1, r0, lsr #16
	mov r0, r8
	ldr r2, [r7, #0x3C]		@ ppMemWrite
	mov r3, r0, lsr#11
	ldr r2, [r2, r3, lsl#2]
	cmp r2, #0
	addne r2, r2, r0
	strneb r1, [r2], #1
	movne r1, r1, lsr#8
	strneb r1, [r2]
	moveq lr, pc	@ call "write16"
	ldreq pc, [r7, #0x4C]

	ldrb r3, [r4], #1
	subs r5, r5, #18
