	ldrh r2, [r7, #0x0a]		@ BP
	ldrh r10, [r7, #0x0c]		@ IX
	mov r2, r2, lsl#16
	add r10, r2, r10, lsl#16
	ldrsb r2, [r4], #1
	add r10, r10, r2, lsl#16
	mov r10, r10, lsr#16
	tst r8, #0x80000000
	ldreqh r8, [r7, #0x14]		@ SS
	add r8, r10, r8, lsl#4
	mov r0, r8
	ldr r2, [r7, #0x38]		@ ppMemRead
	mov r3, r0, lsr#11
	ldr r2, [r2, r3, lsl#2]
	cmp r2, #0
	addne r2, r2, r0
	ldrneb r0, [r2], #1
	ldrneb r3, [r2]
	orrne r0, r0, r3, lsl#8
	moveq lr, pc	@ call "read16"
	ldreq pc, [r7, #0x44]
	mov r12, #1
	;@ RORC_WORD
	mov r3, r0, lsl#16
	and r2, r9, #2		@ CF
	orr r0, r3, r2, lsl#14
	mov r0, r0, lsr r12
	orr r0, r0, r0, lsl#17
	and r9, r0, #0x8000
	mov r9, r9, lsr#14

	mov r1, r0, lsr #16
	mov r0, r8
	ldr r2, [r7, #0x3C]		@ ppMemWrite
	mov r3, r0, lsr#11
	ldr r2, [r2, r3, lsl#2]
	cmp r2, #0
	addne r2, r2, r0
	strneb r1, [r2], #1
	movne r1, r1, lsr#8
	strneb r1, [r2]
	moveq lr, pc	@ call "write16"
	ldreq pc, [r7, #0x4C]

	ldrb r3, [r4], #1
	subs r5, r5, #16
	ldrge pc, [r6, r3, asl#2]
	b ArmNecEnd

